const Countries = React.lazy(() => import("../pages/Countries"));
const WrapperForm = React.lazy(() => import("../WrapperForm"));

const Routes = [
  {
    path: "/countries",
    exact: true,
    component: Countries
  },
  {
    path: "/countries/{id}",
    exact: true,
    component:()=>< WrapperForm  edit ={true}/>
  },

